import React from 'react';
import PostCard from './PostCard';
function Posts({postsToDisplay, setIsLoading}){
    const cards = <div className = "posts-container">
            {
                postsToDisplay.map(post => (
                    <PostCard
                        key = {post.postId}
                        post = {post}
                    />
                ))
            }
        </div>;
    setIsLoading(false);
    return({cards});

}

export default Posts;
